import React, { useState } from 'react';
import './navbar.css';
import logo from '../../assets/logo.png';
import contactImg from '../../assets/contact.png';
import { Link } from 'react-scroll';

const Navbar = () => {
  const [showMenu, setShowMenu] = useState(false);

  return (
    <nav className='navbar'>
      <img src={logo} alt='Logo' className='logo' />

      {/* Desktop Menu */}
      <div className={`desktopMenu ${showMenu ? "active" : ""}`}>
        <Link
          activeClass='active'
          to='intro'
          spy={true}
          smooth={true}
          offset={-100}
          duration={500}
          className='desktopMenuListItem'
        >
          Home
        </Link>
        <Link
          activeClass='active'
          to='skills'
          spy={true}
          smooth={true}
          offset={-50}
          duration={500}
          className='desktopMenuListItem'
        >
          About
        </Link>
        <Link
          activeClass='active'
          to='works'
          spy={true}
          smooth={true}
          offset={-50}
          duration={500}
          className='desktopMenuListItem'
        >
          Portfolio
        </Link>
        <Link
          activeClass='active'
          to='Education'
          spy={true}
          smooth={true}
          offset={-50}
          duration={500}
          className='desktopMenuListItem'
        >
          Education
        </Link>
      </div>

      {/* Mobile Menu Button */}
      <button
        className='desktopMenuBtn'
        onClick={() => setShowMenu(!showMenu)} // Toggle menu visibility
      >
        <img src={contactImg} alt='' className='desktopMenuBtnImg' />
        Contact Me
      </button>
    </nav>
  );
};

export default Navbar;
